        const fileName = `audio_recording_${currentDate.getTime()}.webm`;
        const audioFile = new File([audioBlob], fileName, { type: 'audio/webm' });

        // Create an array with the file for upload
        const fileArray = [{
          name: fileName,
          type: 'audio/webm',
          size: audioBlob.size,
          lastModified: new Date().getTime(),
          file: audioFile
        }];

